"239005":{"id":"239005","name":"Os Desajustados de Seul","slug":"os-desajustados-de-seul","original_title":"강매강","overview":"A Unidade 2 de Crimes Violentos da Polícia de Songwon tem o menor índice de prisões do país. Após seu chefe ser rebaixado, a equipe é exilada em uma creche fechada. Entra Yubin, o novo líder. Apesar da desconfiança inicial da equipe, Yubin e a equipe se unem à medida que resolvem casos juntos.","first_air_date":"2024-09-11","episode_run_time":0,"vote_average":8.429,"number_of_seasons":1,"number_of_episodes":20,"created_by":["Lee Ok-gyu"],"production_companies":["Studio S","BA Entertainment","Chorokbaem Media"],"genres":["Comédia","Crime","Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/vas44Kp1BPca4ou2cBb4orAQ53F.jpg","poster_path":"https://image.tmdb.org/t/p/original/Ak9Jot1xhAyzMMuUxxEMMHxYirL.jpg","cast":["김동욱","박지환","서현우","박세완","Lee Seung-woo"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/Ak9Jot1xhAyzMMuUxxEMMHxYirL.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/Ak9Jot1xhAyzMMuUxxEMMHxYirL.jpg","air_date":"2024-09-11","episode_count":20,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"Uma unidade criminal com a menor taxa de prisão trabalha no primeiro caso com seu novo chefe, Yubin.","air_date":"2024-09-11","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/rxJIi4jnH8PumGbDfyGl11cPvYC.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"A equipe investiga um assassinato disfarçado de suicídio e fica em apuros quando ocorre outra morte.","air_date":"2024-09-11","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/Agh5ryrMYXqbwFZXvy6WkHNWaQ7.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"A equipe avança na investigação com informações da testemunha. Yubin identifica o suspeito.","air_date":"2024-09-11","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/3peQpCP3WiJazrBqNVNwOkqeyuo.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Um incêndio ocorre em uma loja de frango frito administrada por um conhecido de Joongryeok.","air_date":"2024-09-11","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/dwTqvT0xpStjQYaAGG5dOHoMcXA.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"A equipe reduz os suspeitos do incêndio, mas chega a um impasse. Yubin propõe uma teoria chocante.","air_date":"2024-09-18","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/65oszAnl0x2WGA8wqRJWhVZU06v.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"Seguindo a orientação de Yubin, a equipe redireciona sua investigação e descobre novas informações.","air_date":"2024-09-18","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/ijYxO64PcwDOiaDZIpfZh86CecJ.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Uma menina de seis anos é sequestrada. Há ameaças do raptor, e Yubin descarta um suspeito principal.","air_date":"2024-09-25","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/85qhCqAuNCtaV7B6Ojtu6tSPKqJ.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Outra equipe assume o caso, mas a equipe de Yubin ainda investiga em segredo, gerando um confronto.","air_date":"2024-09-25","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/xGRAq5yz2wLAfVD20xCnrSdn6xh.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"Com a pista de Tansik, a equipe se infiltra em uma área restrita e enfrenta uma situação perigosa.","air_date":"2024-10-02","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/mCE7QKxFkj2xnBpmpHqlwWXluky.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"A equipe identifica um suspeito, mas não tem provas. Enquanto isso, o tempo está acabando para eles.","air_date":"2024-10-02","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/7UPxrhaJCDgIusBC4sK6MzeXV2p.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"Uma mulher presa por invasão é vítima de um golpe de romance. A equipe monta uma vigilância.","air_date":"2024-10-09","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/mXiJwMhdDcNM5NVE12UEaqKm8f7.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"A equipe de Yubin atrai o suspeito, mas descobre que as coisas não são o que parecem.","air_date":"2024-10-09","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/wQmc2hkktFiasU6EvpmwXV1ejsR.jpg","vote_average":0},"13":{"name":"Episódio 13","overview":"A equipe assume um caso de roubo de artefato cultural e investiga todos que têm acesso à casa.","air_date":"2024-10-16","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/1PSkAMwrRkNcTpj53217q99ddOf.jpg","vote_average":0},"14":{"name":"Episódio 14","overview":"O suspeito alega que outra pessoa roubou o quadro. A equipe se disfarça para pegar o culpado.","air_date":"2024-10-16","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/4Ib12YzR74UEVSJqDkFUttiewGa.jpg","vote_average":0},"15":{"name":"Episódio 15","overview":"A equipe de Yubin descobre um sindicato de gângsteres e forma o Dongbang Group para se infiltrar.","air_date":"2024-10-23","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/mRmyT82poFEQcU9b1QzFIwKKFBJ.jpg","vote_average":0},"16":{"name":"Episódio 16","overview":"A equipe de Yubin leva uma vida dupla e consegue conhecer o braço direito do chefe do Sindicato MZ.","air_date":"2024-10-23","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/dKtpKSQUTwplIpRd2NPQrOTo4gt.jpg","vote_average":0},"17":{"name":"Episódio 17","overview":"Descobre-se que uma estudante universitária foi assassinada da mesma forma que a noiva de Yubin.","air_date":"2024-10-30","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/rwa95ZfzdOKpvKtFEOMUReYpryK.jpg","vote_average":0},"18":{"name":"Episódio 18","overview":"Hyunwoo identifica o assassino. Junghwan obtém provas das câmeras de segurança, mas corre perigo.","air_date":"2024-10-30","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/xMhXJcsZXvKQzSOSf3620LNOlnn.jpg","vote_average":0},"19":{"name":"Episódio 19","overview":"Joongryeok persegue o agressor de Junghwan, enquanto Yubin descobre que provas cruciais sumiram.","air_date":"2024-10-30","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/1QWt4CWVM1ejl2IvGoAhyHkgSSB.jpg","vote_average":0},"20":{"name":"Episódio 20","overview":"A equipe confia na alegação de Yubin de que o verdadeiro assassino ainda está solto e reúne provas.","air_date":"2024-10-30","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/qYQW41upRqFQH7KzZMsX2ZHLecn.jpg","vote_average":0}}}}},
