"236429":{"id":"236429","name":"Plantão Policial","slug":"plantao-policial","original_title":"On Call","overview":"Repleta de adrenalina, esta série nos coloca em um carro de patrulha da Polícia de Long Beach. Junto ao policial de treinamento Traci Harmon e o novato Alex Diaz, esta série examina como as complexidades do trabalho afetam a condição humana. Harmon será iluminado por um menino das ruas enquanto Diaz aprenderá que o trabalho de policial não é branco ou negro, mas envolve tons de cinza.","first_air_date":"2025-01-09","episode_run_time":0,"vote_average":7.5,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Tim Walsh","Elliot Wolf"],"production_companies":["Wolf Entertainment","Universal Television","Amazon MGM Studios"],"genres":["Crime","Drama","Action & Adventure"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/urgOc75FXlEU64eToxSypCarJoN.jpg","poster_path":"https://image.tmdb.org/t/p/original/zclGqPFfnHrR3Oi0hwetm1Syibr.jpg","cast":["Troian Bellisario","Brandon Larracuente","Lori Loughlin","Eriq La Salle","Mathew Trent Hunnicutt"],"trailer":"9x3aWHOvfQc","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/zclGqPFfnHrR3Oi0hwetm1Syibr.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/zclGqPFfnHrR3Oi0hwetm1Syibr.jpg","air_date":"2025-01-09","episode_count":8,"overview":"N/A","vote_average":7,"episodes":{"1":{"name":"Piloto","overview":"Na esteira de uma tragédia, a policial Traci Harmon, de Long Beach, aceita treinar um novato, Alex Diaz, que logo de cara aprende que seu trabalho é mais duro do que ele imaginava.","air_date":"2025-01-09","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/7OX2RHEYcqpUU0cBWuTUBso31YV.jpg","vote_average":7},"2":{"name":"Leis do Universo","overview":"Uma operação caótica nas ruas surpreende nossos policiais em grande desvantagem numérica, revelando fissuras filosóficas na Divisão Oeste.","air_date":"2025-01-09","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/obSfS1Ul0YbLp0CojjViX1kkbmy.jpg","vote_average":7},"3":{"name":"Ao Sul do Paraíso","overview":"Diaz descobre que Harmon tem inimigos na própria Divisão Oeste e começa temê-la, pensando que ela talvez não seja confiável.","air_date":"2025-01-09","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/AjirmjWh7Ae6LaA0toHC1n13mNZ.jpg","vote_average":7},"4":{"name":"Desconhecido","overview":"Louca por uma pista, Harmon quebra algumas regras, o que resulta em uma importante descoberta e um confronto mortal.","air_date":"2025-01-09","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/3bNGtn9e8ovWHV0cYGK7JIlZ7PB.jpg","vote_average":7},"5":{"name":"Não É Seu Salvador","overview":"De volta à patrulha, o distanciamento entre Harmon e Diaz chega ao ápice.","air_date":"2025-01-09","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/1zf9vmUZ5l903K4UbEaP1XbZZ95.jpg","vote_average":7},"6":{"name":"Mulher de Los Angeles","overview":"Quando a família de Diaz é ameaçada, Harmon percebe que deve quebrar as próprias regras para resolver a situação.","air_date":"2025-01-09","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/toBS8x3DI2V4YUU0Bzf7i1gi7To.jpg","vote_average":7},"7":{"name":"Máquina de Guerra","overview":"Uma missão de vingança acaba deixando a Divisão Oeste cara a cara com uma gangue inteira.","air_date":"2025-01-09","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/v3pfnolOUVax5rocY8JF53gxyRK.jpg","vote_average":7},"8":{"name":"Como o Oeste Foi Conquistado","overview":"Harmon e Diaz unem forças com um esquadrão de elite para interceptar uma enorme remessa de drogas.","air_date":"2025-01-09","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/dnW5Xwd5aPt5LROvIDeMZiY0qZM.jpg","vote_average":7}}}}},
