"128876":{"id":"128876","name":"The Beatles: Get Back","slug":"the-beatles-get-back","original_title":"The Beatles: Get Back","overview":"Um documentário dividido em três partes e compilado a partir de mais de 60 horas de imagens nunca vistas, que mostra o entusiasmo, o companheirismo e a incrível criatividade que são a marca do legado do quarteto mais icônico do cenário musical: os Beatles. A série também incluirá, pela primeira vez na íntegra, o último show dos Beatles na Savile Row, em Londres.","first_air_date":"2021-11-25","episode_run_time":0,"vote_average":8.4,"number_of_seasons":1,"number_of_episodes":3,"created_by":["Peter Jackson"],"production_companies":["WingNut Films","Apple Corps"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/4ILR1s7X1vpD8ZzP7XGIMOc4H0Z.jpg","poster_path":"https://image.tmdb.org/t/p/original/nxy9fg1rT853P7zP7ZQGqRimiCS.jpg","cast":["John Lennon","Paul McCartney","George Harrison","Ringo Starr"],"trailer":"rfdkH2MGEmY","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/nxy9fg1rT853P7zP7ZQGqRimiCS.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/nxy9fg1rT853P7zP7ZQGqRimiCS.jpg","air_date":"2021-11-25","episode_count":3,"overview":"N/A","vote_average":8.9,"episodes":{"1":{"name":"Parte 1: Dias 1-7","overview":"Os Beatles têm apenas três semanas para compor 14 canções para um álbum e preparar um show ao vivo. Quando chegam aos estúdios Twickenham, começam a sentir os efeitos da pressão.","air_date":"2021-11-25","runtime":157,"still_path":"https://image.tmdb.org/t/p/original/9b4B2ph6dLNhO4hwz9XnhaSSc1D.jpg","vote_average":8.6},"2":{"name":"Parte 2: Dias 8-16","overview":"George decide deixar a banda, e Paul, John e Ringo esperam que ele mude de ideia. Eles transferem as sessões para o recém-construído estúdio da Apple na rua Savile Row, em Londres.","air_date":"2021-11-26","runtime":173,"still_path":"https://image.tmdb.org/t/p/original/x5uovxcgoy2O8h7W32G4RczNa2i.jpg","vote_average":8.7},"3":{"name":"Parte 3: Dias 17-22","overview":"Com o novo álbum quase pronto e após desistirem do especial para a TV, os Beatles devem decidir se mantêm os planos e se apresentam ao vivo pela primeira vez em três anos. A banda e a equipe tentam encontrar um lugar conveniente para o show.","air_date":"2021-11-27","runtime":138,"still_path":"https://image.tmdb.org/t/p/original/doxaRloiVxawjpVufN1k9QCBzsj.jpg","vote_average":9.3}}}}},
