"211039":{"id":"211039","name":"Senna","slug":"senna","original_title":"Senna","overview":"A trajetória de superação, desencontros, alegrias e tristezas do tricampeão de Fórmula 1, Ayrton Senna, desbravando sua personalidade e suas relações pessoais. O ponto de partida será o começo da carreira automobilística do Ayrton, quando ele se muda para a Inglaterra para competir na Fórmula Ford, até o trágico acidente em Ímola, na Itália, durante o Grande Prêmio de San Marino.","first_air_date":"2024-11-29","episode_run_time":0,"vote_average":8.2,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Vicente Amorim"],"production_companies":["Gullane Entretenimento"],"genres":["Drama","Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/pP9Or3dN8k0go1G2OSldcwBpUFO.jpg","poster_path":"https://image.tmdb.org/t/p/original/3WMHCcYR2pVWyc85h3kLev20nbk.jpg","cast":["Gabriel Leone","Kaya Scodelario","Matt Mella","Patrick Kennedy","Arnaud Viard"],"trailer":"AGT5bUsOPLk","seasons":{"1":{"name":"Minissérie","poster_path":"https://image.tmdb.org/t/p/original/yxkrrtyOzx36uHowqYB3Ec8b9wg.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/yxkrrtyOzx36uHowqYB3Ec8b9wg.jpg","air_date":"2024-11-29","episode_count":6,"overview":"N/A","vote_average":8.1,"episodes":{"1":{"name":"Vocação","overview":"Ayrton Senna começa sua carreira no automobilismo na Fórmula Ford. Longe de casa e sonhando alto, ele busca por reconhecimento e mais oportunidades na pista.","air_date":"2024-11-29","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/hCeF3A4RPa5O3F0hIxs9PaAu8EV.jpg","vote_average":8},"2":{"name":"Determinação","overview":"Uma viagem à Itália resulta em um melhor desempenho nas pistas. Após chamar a atenção de Peter Warr, Senna faz uma escolha decisiva. Alain Prost cruza o caminho de Senna.","air_date":"2024-11-29","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/XojH7NRLvZEQVmmKDGVX7421XQ.jpg","vote_average":7.4},"3":{"name":"Ambição","overview":"Galvão analisa o dever de Senna com o Brasil. Uma noite de karaokê abre portas. A rivalidade entre Ayrton e Prost se intensifica antes do Campeonato Mundial de 1988.","air_date":"2024-11-29","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/n8ntLGwDGEHjeq7hVA6kiiX2FjF.jpg","vote_average":8.6},"4":{"name":"Paixão","overview":"O romance de Senna com Xuxa agita a imprensa. Um motor quebrado, conflitos públicos e drama nas pistas aumentam a tensão entre Senna e Prost.","air_date":"2024-11-29","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/zuQ90Vq1ylY89u90XhqLUzB2dTN.jpg","vote_average":8.7},"5":{"name":"Herói","overview":"Após a polêmica coletiva de imprensa de Senna, Balestre anuncia os pilotos da temporada. Prost deixa a McLaren, e Senna supera limites em busca da vitória.","air_date":"2024-11-29","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/2yuxJGrKSBO5gmDgkkyvhUqvUjP.jpg","vote_average":8.6},"6":{"name":"Tempo","overview":"Senna faz uma mudança decisiva na carreira. Após amigos sofrerem acidentes nas pistas, ele luta por mais medidas de segurança antes da fatídica corrida de Ímola.","air_date":"2024-11-29","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/5oLqeR1vScPjsHEOjYslRLlXgbx.jpg","vote_average":7.2}}}}},
