"232488":{"id":"232488","name":"Planeta Energia","slug":"planeta-energia","original_title":"Planeta Energia","overview":"Inovações na área de geração de energia prometem alterar a matriz energética da humanidade em pouco tempo. Nesta série veremos como essas tecnologias podem mudar o nosso mundo.","first_air_date":"2023-06-30","episode_run_time":0,"vote_average":0,"number_of_seasons":1,"number_of_episodes":16,"created_by":[],"production_companies":["Medialand"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/zgfxJSSFEVA2tX400ksM8qJ2j9X.jpg","poster_path":"https://image.tmdb.org/t/p/original/uh5oU72J5VeBmYq114XY1SwqK4f.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/uh5oU72J5VeBmYq114XY1SwqK4f.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/uh5oU72J5VeBmYq114XY1SwqK4f.jpg","air_date":"2023-06-30","episode_count":16,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Biomassa","overview":"A Biomassa é uma fonte de energia transformadora. Os benefícios e as desvantagens dessa fonte de energia são colocados a prova nesse episódio, que explora os processos de conversão da Biomassa em energia e a tecnologia utilizada.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Biogás","overview":"A geração, as aplicações, as fontes e o ciclo do Biogás são discutidos por nossos especialistas para averiguar as vantagens e desvantagens desse combustível que já teve a sua produção incentivada pelo governo brasileiro.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Hidrelétricas","overview":"Maior fonte energética do país, a energia Hidrelétrica é uma das formas de geração de energia mais limpa existente, mas o impacto ambiental e social que a construção de uma barragem acarreta também deve ser levado em consideração.","air_date":"2023-06-30","runtime":48,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Petróleo","overview":"Desde a sua descoberta, o Petróleo tem sido o combustível mais eficaz e, atualmente, junto com o gás natural, representa mais de 50% da energia consumida. Serão necessárias décadas até que o Petróleo deixe ditar a matriz energética.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Gás Natural","overview":"Com a necessidade de mais investimentos em infraestrutura, o Gás Natural pode ser o combustível da transição entre os combustíveis fósseis e combustíveis renováveis, uma vez que é o combustível fóssil com menor taxa de emissão de CO2.","air_date":"2023-06-30","runtime":46,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Geotérmica","overview":"Com diferentes tecnologias para atingir seus objetivos, que vão desde a produção de energia e aquecimento, até o resfriamento, a Geotérmica se apresenta como uma solução energética para vários países, como a Islândia, que gera 30% de sua energia a partir de fontes geotérmicas. No Brasil, o potencial geotérmico maior é o de resfriamento.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"7":{"name":"Eólica","overview":"O Brasil é um país rico em recursos naturais para produção de energia. Dentre elas, a energia eólica é a com menor impacto ambiental e social, sendo a segunda maior fonte de energia no país e a forma de produção de energia mais barata. Para os próximos 15 anos, é a forma de geração de energia com maior previsão de crescimento.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"8":{"name":"Solar","overview":"Desde os anos 70, o preço da energia fotovoltaica diminuiu em 253 vezes, e, até 2050, espera-se uma redução adicional de 30% a 50%. O Brasil vem incluindo a energia solar na sua matriz energética, principalmente a partir de 2012, quando uma resolução da ANEEL permitiu que os produtores de energia trocassem seus excedentes por créditos.","air_date":"2023-06-30","runtime":44,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"9":{"name":"Baterias","overview":"A evolução da segurança, durabilidade e potência das baterias, pode ser vista na bateria de Lítio, que é peça chave na substituição dos veículos à combustão para os elétricos. No Brasil, a expectativa é que a implementação do veículo elétrico comece a partir de automóveis de grande porte, como ônibus e caminhões.","air_date":"2023-06-30","runtime":46,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"10":{"name":"Microgeração","overview":"Desde 2012, graças a uma resolução da ANEEL, todo brasileiro pode ser um microprodutor de energia. É possível injetar a energia excedente na rede, receber créditos em troca e utilizá-los para abater valores da conta de energia. A geração dessa energia pode ter diversas origens, seja ela solar, eólica ou de qualquer outra fonte.","air_date":"2023-06-30","runtime":48,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"11":{"name":"Oceanos","overview":"Seja através das ondas, das marés ou das correntes oceânicas o potencial de geração de energia nos oceanos é grande, mas ainda necessita de uma redução de custos. Além disso, é possível construir parques eólicos no oceano, com as vantagens de utilizar turbinas maiores, a maior intensidade do vento e a menor turbulência.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"12":{"name":"Termoelétricas","overview":"A termoelétrica gera energia a partir do calor. Esse calor é proveniente da queima de combustíveis como carvão, gás natural e biomassa. O Brasil, que se destaca pela queima de biomassa, pode reforçar sua matriz energética com gás natural.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"13":{"name":"Nuclear","overview":"A energia nuclear pode ser considerada a mais limpa de todas, mas os seus propósitos bélicos a tornaram um tabu. Seu uso na medicina, na propulsão naval e na propulsão espacial a tornam cada vez mais importante.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"14":{"name":"Células a Combustível","overview":"A célula à combustível, ou pilha à combustível, é mais antiga que o motor à combustão. Ela pode ser utilizada no controle remoto, no automóvel e, até mesmo, em viagens espaciais, sendo o conversor de energia mais eficiente que existe.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"15":{"name":"Cinética","overview":"As formas de produzir energia se tornam cada vez mais diversificadas. A energia cinética, relativamente nova no quesito de produção, é capaz de transformar os movimentos de pessoas, dançarinos e até mesmo carros em energia elétrica.","air_date":"2023-06-30","runtime":44,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"16":{"name":"Especialistas","overview":"Nesse episódio final, nossos especialistas discutem a rede elétrica, a matriz energética e as principais fontes de energia do Brasil, um país com a produção de energia limpa, se comparado com o resto do mundo.","air_date":"2023-06-30","runtime":46,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
