"124339":{"id":"124339","name":"1971: O Ano em Que a Música Mudou o Mundo","slug":"1971-o-ano-em-que-a-musica-mudou-o-mundo","original_title":"1971: The Year That Music Changed Everything","overview":"Em uma era de turbulência política e cultural, o ano de 1971 foi marcado pela inovação e renascimento musical. Estrelas ganharam mais projeção, novos talentos entraram em cena e os limites se expandiram como nunca antes.","first_air_date":"2021-05-21","episode_run_time":0,"vote_average":7.7,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Asif Kapadia"],"production_companies":["Mercury Studios","On the Corner Films"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/f6Xfluys6C6BHOTKXpn5nTAvxMk.jpg","poster_path":"https://image.tmdb.org/t/p/original/tmq56JYUMh5xik1FHMgtbhjwHOP.jpg","cast":[],"trailer":"VqEvm8lyT9E","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/tmq56JYUMh5xik1FHMgtbhjwHOP.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/tmq56JYUMh5xik1FHMgtbhjwHOP.jpg","air_date":"2021-05-21","episode_count":8,"overview":"N/A","vote_average":7.1,"episodes":{"1":{"name":"O que está acontecendo?","overview":"Enquanto a agitação dos anos 60 evolui para uma nova década, músicos como Marvin Gaye e John Lennon tornam-se a consciência da cultura.","air_date":"2021-05-21","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/5zhbwcKEJJeNz0IOAbdFGlyFmaL.jpg","vote_average":8},"2":{"name":"O sonho ácido acabou","overview":"Sly Stone, The Rolling Stones e Jim Morrison escondem-se do mundo, mas não há escapatória da crescente epidemia de drogas pesadas.","air_date":"2021-05-21","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/eqRniRwwHNdQyRXrhaOsEyTA6Ad.jpg","vote_average":7},"3":{"name":"Mudanças","overview":"Novos sons e estilos emergem, seguindo o término dos Beatles, com Marc Bolan e Alice Cooper trazendo o glamour para o mundo.","air_date":"2021-05-21","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/oEKsOq2flUDEKfp7SIVVpcsXerx.jpg","vote_average":7},"4":{"name":"Nossa hora é agora","overview":"Carole King e Joni Mitchell acabam com os limites machistas e gravam discos icônicos. Elton John e Lou Reed exploram a música e a cultura queer.","air_date":"2021-05-21","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/oe7lzT0X096omyMnKgo0izN4iWh.jpg","vote_average":6.5},"5":{"name":"A revolução não será televisionada","overview":"A América está em convulsão com uma agitação racial profunda. Curtis Mayfield, The Last Poets e Gil Scott-Heron escrevem sobre a revolução que parece iminente.","air_date":"2021-05-21","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/ks3Nj7rjpL4P8GLsAkcM3MpcaHr.jpg","vote_average":8.5},"6":{"name":"Exílio","overview":"Drogas, bebida e a devassidão alcançam um pico devastador – ainda assim Sly Stone, The Rolling Stones e Jim Morrison produzem algumas de suas melhores músicas.","air_date":"2021-05-21","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/bKMtCinF8xRqpREVtmBvUutnV8i.jpg","vote_average":7},"7":{"name":"Respeito","overview":"James Brown, Ike e Tina Turner, e os artistas da Stax Records fazem música em seus próprios termos apesar de trabalharem numa indústria tomada pelo racismo,","air_date":"2021-05-21","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/1NP2XpH0UMFRU7fm3n8gtyyqrNy.jpg","vote_average":7},"8":{"name":"Homem nas estrelas","overview":"Final da Série. Com o reggae e os sintetizadores em alta, uma gama de artistas – de Iggy Pop e Lou Reed a Alice Cooper – inspiram um triunfo criativo.","air_date":"2021-05-21","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/rwRNw8mrKtlykr0ZxGSLMStlTwb.jpg","vote_average":6}}}}},
