"230418":{"id":"230418","name":"Roubo por Vingança","slug":"roubo-por-vinganca","original_title":"चूना","overview":"Um grupo de rebeldes descobre um inimigo comum em um político cruel e planeja um assalto para se vingar.","first_air_date":"2023-09-29","episode_run_time":0,"vote_average":6.2,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Pushpendra Nath Misra"],"production_companies":["Flying Saucer Media"],"genres":["Comédia","Crime","Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/ygykAssQceF0mF6yCPyX3JqDuxO.jpg","poster_path":"https://image.tmdb.org/t/p/original/sndjLMuA00PVjxAqhEVPvE9b6rG.jpg","cast":["Jimmy Shergill","Arshad Warsi","Aashim Gulati","Namit Das","Atul Srivastava"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/sndjLMuA00PVjxAqhEVPvE9b6rG.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/sndjLMuA00PVjxAqhEVPvE9b6rG.jpg","air_date":"2023-09-29","episode_count":8,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"Dormir com os peixes","overview":"Shukla, um político com sede de poder, planeja derrubar o governo. Dois estranhos azarados descobrem que têm um inimigo comum e buscam vingança.","air_date":"2023-09-29","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/qlj2zDHPjAgqZ82BBIXLK8MvN17.jpg","vote_average":10},"2":{"name":"Inimigo do meu inimigo","overview":"Ansari e J.P. Yadav se unem a um policial e um golpista. A equipe começa a tomar forma e bolar um plano para roubar o dinheiro sujo de Shukla.","air_date":"2023-09-29","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/qruxYEw9zuYRSSRJur1yznnTUIz.jpg","vote_average":0},"3":{"name":"Brincando com fogo","overview":"Alguém próximo a Shukla se torna um aliado silencioso, mas vingativo. Um incêndio em Pathaani Tola faz Ansari entrar em ação.","air_date":"2023-09-29","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/j2zQpL2cz1KR8COhefJnKfwIcdz.jpg","vote_average":0},"4":{"name":"Segredos revelados","overview":"Shukla tenta afastar Ansari e Baankeylal. Os antigos aliados de Ansari buscam vingança, e Bela é pega no fogo cruzado.","air_date":"2023-09-29","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/lWxLZbunAdq0MzLCmv1DSHcicgk.jpg","vote_average":0},"5":{"name":"E assim começa...","overview":"Um sequestro faz Bela tomar as rédeas da situação. Baankeylal fica bêbado e coloca a missão em risco, causando problemas para o grupo.","air_date":"2023-09-29","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/a6allk19zaKNloKdS3JxZQBngbA.jpg","vote_average":0},"6":{"name":"Et tu, Brute?","overview":"Disfarçado de vidente onisciente, Triloki se aproxima de Shukla. A lealdade de Ansari é questionada, e o planejamento do assalto entra em crise.","air_date":"2023-09-29","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/A3AlmWrp4NSG0SOPcfxG7wXVlTL.jpg","vote_average":0},"7":{"name":"Presos antes do roubo","overview":"No dia do eclipse solar, começa o assalto. Mas dificuldades inesperadas abalam os minuciosos planos da equipe.","air_date":"2023-09-29","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/wWgCO4p6sCslIMMdoa6wm4baSZ2.jpg","vote_average":0},"8":{"name":"O eclipse","overview":"Uma surpresa faz o plano avançar. Será que as coisas vão dar certo para os criminosos ou a sorte vai ficar do lado de Shukla?","air_date":"2023-09-29","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/4FZIM108VrtdAiTcR69t3WnGUpI.jpg","vote_average":0}}}}},
